Remove ObjectId from mongodb document serialized to JSON in C#<p>I'm having a bit of an issue here. I am getting all my products from a mongodb collection with this function: </p>

<pre><code>public async Task&lt;string&gt; getAllProducts()
        {
            List&lt;string&gt; all = new List&lt;string&gt;();

            var document = await getCollection("produits").Find(new BsonDocument()).ToCursorAsync();
            foreach (var doc in document.ToEnumerable())
            {
                var res = doc.ToJson();
                all.Add(res);
            }
            return JsonConvert.SerializeObject(all);
        }
</code></pre>

<p>and it returns a JSON that looks like this to my react front end.</p>

<pre><code>{ "_id" : ObjectId("5e49bdf5f040e808847a17d7"), 
"email" : "example@gmail.com", 
"quantite" : 1, 
"matricule" : 1}
</code></pre>

<p>problem is i cant parse this in my javascript because of this : <strong>ObjectId("5e49bdf5f040e808847a17d7")</strong></p>

<p>Of course I could do some string magic before I parse it, but id rather it be corrected on the server side. So is there a way I can get rid of this problem and get a result like this? </p>

<pre><code>{ "_id" : "5e49bdf5f040e808847a17d7", 
    "email" : "example@gmail.com", 
    "quantite" : 1, 
    "matricule" : 1}
</code></pre>

