<p>I'm building a landing page query (think Netflix page) and need to get ~15 results for each categories (think Comedy, Horror, Drama, ...). </p>

<p>It seems not like a great solution to send a query for each "category" and deal with the callback issues as well as a heavy request on the database for a simple page load...as illustrated below: </p>

<pre><code>const categories = ['horror','drama','comedy']
let counterCallback = 0
let allShows = []
categories.map(category =&gt;{
    Show.find({category: category},{limit: 15}, (err, shows)=&gt;{
       if(shows){ allShows.push(shows)}
       allShows++
       if(allShows === categories.length){ return res.json(allShows) }
    })
})
</code></pre>

